//随机数
const getNum = (start, end) => {
    return parseInt((Math.random() * (end - start + 1) + start));
}

// type 1奇数  2偶数
const rand = (type) => {
    let num = getNum(0, 9);
    if (type === 1) {
        if (num % 2 !== 0) {
            return num;
        } else {
            return rand(type);
        }
    } else {
        if (num % 2 === 0) {
            return num;
        } else {
            return rand(type);
        }
    }
}


//生成qq号
const QQNum = () => {
    let num = '';
    for (let i = 0; i < 10; i++) {
        if (i === 0) {
            num += getNum(1, 9)
            continue;
        }
        num += getNum(0, 9)
    }
    return num;
}

