//生成身份证
const generateID = (birthday, cityCode, sex) => {

    if (!sex) {
        sex = getNum(1, 2);
    }

    let address;

    let coefficientArray = ["7", "9", "10", "5", "8", "4", "2", "1", "6", "3", "7", "9", "10", "5", "8", "4",
        "2"
    ]; // 加权因子
    let lastNumberArray = ["1", "0", "X", "9", "8", "7", "6", "5", "4", "3", "2"]; // 校验码

    //生成生日
    if (!birthday) {
        let y = getNum(1950, new Date().getFullYear());

        let m = getNum(1, 12) + ''

        if (m.length === 1) {
            m = '0' + m
        }

        let d = getNum(1, 28) + ''

        if (d.length === 1) {
            d = '0' + d
        }

        birthday = y + m + d; // 生日
    } else {
        birthday = birthday.replaceAll('-', '')
    }

    //生成住址
    if (cityCode.length === 0) {
        address = CITY_CODE[getNum(0, CITY_CODE.length - 1)] + "0101"; // 住址
    } else {
        address = cityCode[cityCode.length - 1]
    }

    // console.log(address,birthday,sex)

    let s = Math.floor(Math.random() * 10).toString() + Math.floor(Math.random() * 10).toString() + rand(sex);

    let array = (address + birthday + s).split("");
    let total = 0;
    for (let i in array) {
        total = total + parseInt(array[i]) * parseInt(coefficientArray[i]);
    }
    let lastNumber = lastNumberArray[parseInt(total % 11)];
    return address + birthday + s + lastNumber
}

